#footer .parent_subscribe_email_div em.error { color: red; position: absolute; margin-top: 60px; }

#footer #newsletter_form .form_div { gap: 10px; }

@media (min-width: 1025px) {
  #nav_element { text-align: right; width: fit-content; float: left; margin-right: 0px; }
}

@media (max-width: 767px) {
  .hero_video_section .hero_content_section, .smarter_decision_div { text-align: -webkit-center; }
  .smarter_decision_div h3 { font-size: 1.4rem; }
  .adaptive-dashboard-div .request_demo_and_sign_in_btn { justify-content: center; }
  .counter_card { text-align: center; }
  .white_navbar .main-menu > ul > li > a, .white_navbar ul > li.submenu > a::after { color: rgb(0, 0, 0) !important; }
  .right-side_bar { border-right: none; border-bottom: 1px solid rgba(255, 255, 255, 0.3); padding-bottom: 15px; margin-bottom: 15px; }
  .counter_card .col-sm-3:last-child { border-bottom: none; }
  .industry-list { gap: 8px; }
  .industries_we_empower_mobile_carousel { display: block; }
  .industries_we_empower_desktop_carousel { display: none; }
  .industries_we_empower_mobile_carousel .carousel-container { margin-top: -60px; }
  #footer .linkedin_logo { margin-top: 15px; }
  #collapse_4 .follow_us { margin-top: 15px; }
  #footer #collapse_4 .follow_us .footer-selector { margin-top: 10px; }
}

@media (max-width: 575.98px) {
  .testimonial_card { max-height: 200px; min-height: 200px; }
  #footer .input_and_button_div { display: contents; }
  #footer .input_and_button_div button { margin-top: 3px; }
  #footer .parent_subscribe_email_div { justify-content: center; gap: 10px; padding: 0px 10px; }
  #footer #collapse_5 .follow_us, #footer #collapse_5 .follow_us .footer-selector { margin-top: 20px; }
}

@media (min-width: 576px) and (max-width: 767.98px) {
  .testimonial_card { max-height: 250px; min-height: 250px; }
}

@media (min-width: 768px) and (max-width: 991.98px) {
  .testimonial_card { max-height: 225px; min-height: 225px; }
}

@media (min-width: 992px) and (max-width: 1199.98px) {
  .testimonial_card { max-height: 245px; min-height: 245px; }
}

@media (min-width: 1200px) and (max-width: 1399.98px) {
}
